import { Link } from 'react-router-dom';
import './WppBoton.css'

export default function WppBoton() {
  return (
    <Link target="_blank" to={"https://wa.link/ye9ii9"} className="WppBtn">
      <WhatsAppIcon sx={{ fontSize: "2.2em" }} />
    </Link>
  );
}
